import React from 'react'

import Calvin from './../src/Assests/Images/Calvin.png'

function SuperDry() {
    return (
        <div>
            <h1>SuperDry</h1>
            <img src={Superdry}  alt='' className='pic'/>
            <p> Superdry plc (stylised as SUPERDRY®︎冒険魂) is a UK branded clothing company, and owner of the Superdry label. Superdry products combine vintage Americana styling with Japanese inspired graphics. It is listed on the London Stock Exchange.</p>
        </div>
    )
}

export default SuperDry
